/**
 * Navigate to a given breadcrumb link
 * This helper yields the breadcrumb element.
 *
 * @example
 * ```ts
 *    cy.get('[data-testid="breadcrumbs]')
 *      .then(navigateTo('Previous'))
 * ```
 */
export var navigateTo = function (linkName) { return function ($element) {
    cy.wrap($element)
        .contains(linkName)
        .click();
    return cy.wrap($element);
}; };
